func:
var bearing = msg.payload.hdgs;
if (!bearing) {
    bearing = msg.payload.trk;
}
msg.payload = {
    name: msg.payload.hex,
    lat: msg.payload.lat,
    lon: msg.payload.lon,
    icon: "plane",
    iconSize: 32,
    label: msg.payload.fli,
    bearing: bearing,
    speed: msg.payload.spd,
    alt: msg.payload.alt,
}
return msg;
